import React, { Component } from "react";
import "./feed.css";
import Share from "../share/Share";
import Post from "../post/Post";

import { Posts } from "../../dummyData";
export default class Feed extends Component {
  render() {
    return (
      <div className="feed">
        <div className="feedWrapper">
          <Share />
          {Posts.map((p) => (
            <Post post={p} />
          ))}
        </div>
      </div>
    );
  }
}
